import Header from '../components/header'

export default function about() {
    return (
        <div>
            <Header></Header>
            <h3>My Story</h3>
            <p>Here is where I explain my journey of how I got into software development.</p>
            <p>Some of the languages and frameworks that I've learned</p>
            <p>Explain the projects I've done and have screenshots</p>
            <p>My career goal and where I see myself is the future</p>
            <p>Some of my hobbits and games that I enjoy playing</p>
        </div>
    );
}
